import React from 'react';
import './Listitem.css';

function List(props){
    const items = props.item;
    const listItems = items.map(item => {
        return <div className="row mx-auto">
            <div className="col-12">
                <div className="list bg-warning" key="item.key">
                    <p>{item.text}</p>
                    <i className="fa fa-trash"></i>
                </div>
            </div>
        </div>
    })
    return(
        <div>
            {listItems}
        </div>
    )
}

export default List;
